import AddIcon from "@mui/icons-material/Add";
import {

  UpdateReactType,
  Updatepagenum,
} from "./GlobalActions";

import { useInView } from "react-intersection-observer";

function Tutorialx({ type }: any) {
  const {
    REACT_APP_SUPERSTARZ_URL,
    REACT_APP_CLOUNDFRONT,
    REACT_APP_APPX_STATE,
  } = process.env;

  return <>


    <Grid container

      style={{
        height: "0px",
        width: '100%',
        position: 'fixed',
        top: '60vh',
        left: '20vw',
        zIndex: 50000,
        color: 'whitesmoke',
        fontFamily: 'sans-serif'
      }}>
      <Grid
        xs={12}
        item

      >

        <span style={{
          backgroundColor: 'black',
          padding: '3vh',
        }}>Click On Interactive Point To Get Response</span>

      </Grid>

    </Grid>


  </>;
}

export const Tutorial = React.memo(Tutorialx);
